import React from "react";
import Modal from "react-modal";
import "../style.css"; // Ensure correct styles

const ProductSection1 = ({ selectedCategory }) => {
  const [modalData, setModalData] = React.useState(null);

  const products = [
    { id: 1, primaryImage: "/images/product/37.jpg", name: "Necklace Set", category: "Women", oldPrice: "Rs. 45,654", currentPrice: "Rs. 44,015", description: "A stunning gold necklace set with diamonds.", rating: 4.5 },
    { id: 2, primaryImage: "/images/product/38.jpg", name: "Golden Necklace", category: "Women", oldPrice: "Rs. 30,000", currentPrice: "Rs. 25,000", description: "A beautiful gold necklace for every occasion.", rating: 4.2 },
    { id: 3, primaryImage: "/images/product/39.jpg", name: "Gold Pendant", category: "Men", oldPrice: "Rs. 20,000", currentPrice: "Rs. 18,000", description: "Perfect for traditional and modern outfits.", rating: 4.0 },
    { id: 4, primaryImage: "/images/product/40.jpg", name: "Diamond Ring", category: "Men", oldPrice: "Rs. 50,000", currentPrice: "Rs. 45,000", description: "A beautifully crafted diamond ring.", rating: 4.8 },
    { id: 5, primaryImage: "/images/product/41.jpg", name: "Silver Earrings", category: "Other", oldPrice: "Rs. 15,000", currentPrice: "Rs. 12,500", description: "Elegant silver earrings for daily wear.", rating: 4.3 },
  ];

  const openModal = (product) => setModalData(product);
  const closeModal = () => setModalData(null);

  return (
    <section className="product_section">
      <div className="container">
        <h2 style={{ color: "white" }}>Products - {selectedCategory}</h2>
        <div className="row">
          {products
            .filter((product) => selectedCategory === "All" || product.category === selectedCategory)
            .map((product) => (
              <div className="col-lg-3 col-md-4 col-sm-6 mb-4" key={product.id}>
                <div className="single_product">
                  <div className="product_thumb">
                    <a href="#" className="primary_img">
                      <img src={product.primaryImage} alt={product.name} />
                    </a>
                    <div className="quick_button">
                      <button onClick={() => openModal(product)}>Quick View</button>
                    </div>
                  </div>
                  <div className="product_content">
                    <h3 style={{ color: "white" }}>{product.name}</h3>
                    <p style={{ color: "#FFA500", fontSize: "14px", marginTop: "5px" }}>{product.description}</p>
                    <div className="price_box">
                      <span className="old_price">{product.oldPrice}</span>
                      <span className="current_price">{product.currentPrice}</span>
                    </div>
                  </div>
                </div>
              </div>
            ))}
        </div>

        {/* Modal */}
        {modalData && (
          <Modal isOpen={!!modalData} onRequestClose={closeModal}>
            <h2>{modalData.name}</h2>
            <img src={modalData.primaryImage} alt={modalData.name} />
            <p>{modalData.description}</p>
            <div>
              <span className="old_price">{modalData.oldPrice}</span>
              <span className="current_price">{modalData.currentPrice}</span>
            </div>
            <button onClick={closeModal}>Close</button>
          </Modal>
        )}
      </div>
    </section>
  );
};

export default ProductSection1;
